import React, { Component } from 'react';
import './App.css';
import { Router, Route, Switch } from 'react-router-dom';
import Form from './Form';


class App extends Component { 
  render(){
    return (
      <div >
          <Router>
            <Switch>
                  <Route exact  path='/'  component={<Form></Form>}/>
            </Switch>
          </Router>
      </div>  
    );
  }
}

export default App;
